import React, { useEffect, useState } from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import MenuItem from "@mui/material/MenuItem";
import { styled } from "@mui/material/styles";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell, { tableCellClasses } from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Button from "@mui/material/Button";
import Switch from '@mui/material/Switch';
import { Formik, Form, Field } from "formik";
import Dialog from "@mui/material/Dialog";
import DialogTitle from "@mui/material/DialogTitle";
import DialogContent from "@mui/material/DialogContent";
import DialogActions from "@mui/material/DialogActions";
import IconButton from "@mui/material/IconButton";
import CloseIcon from "@mui/icons-material/Close";
import InteviewPortal from "./InteviewPortal";
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import axios from "axios";

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": {
    padding: theme.spacing(2),
  },
  "& .MuiDialogActions-root": {
    padding: theme.spacing(1),
  },
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${tableCellClasses.head}`]: {
    backgroundColor: "#1976d2",
    color: theme.palette.common.white,
  },
  [`&.${tableCellClasses.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
  },
  "&:last-child td, &:last-child th": {
    border: 0,
  },
}));

const Categary = () => {
  const [open, setOpen] = useState(false);
  const [ini, setIni] = useState({ categoryName: '' });
  const [list, setList] = useState([]);
  const [editId, setEditId] = useState(null);
  const [searchCat, setSearchCat] = useState('');

  const authHeader = {
    headers: {
      Authorization: "YOUR_JWT_TOKEN",
    }
  };

  const handleClickOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleSubmit = (values, { resetForm }) => {
    if (editId !== null) {
      axios.patch(`https://interviewback-ucb4.onrender.com/category/${editId}`, values, authHeader)
        .then(() => {
          console.log('Edit successful');
          fetchCategories();
        })
        .catch((err) => console.error(err));
    } else {
      axios.post('https://interviewback-ucb4.onrender.com/category/create', values, authHeader)
        .then(() => {
          console.log('Category added');
          fetchCategories();
        })
        .catch((err) => console.error(err));
    }
    
    setIni({ categoryName: '' });
    setEditId(null);
    resetForm();
    handleClose();
  };

  const fetchCategories = () => {
    axios.get('https://interviewback-ucb4.onrender.com/category/', authHeader)
      .then((res) => setList(res.data.data))
      .catch((err) => console.error(err));
  };

  const deleteCategory = (id) => {
    axios.delete(`https://interviewback-ucb4.onrender.com/category/${id}`, authHeader)
      .then(() => {
        console.log('Category deleted');
        fetchCategories();
      })
      .catch((err) => console.error(err));
  };

  const searchCategory = (e) => {
    const value = e.target.value;
    setSearchCat(value);

    axios.get(`https://interviewback-ucb4.onrender.com/category/?search=${value}`, authHeader)
      .then((res) => setList(res.data.data))
      .catch((err) => console.error('Search error:', err));
  };

  const editCategory = (id, row) => {
    setIni(row);
    setEditId(id);
    handleClickOpen();
  };

  useEffect(() => {
    fetchCategories();
  }, []);

  return (
    <InteviewPortal>
      <Box sx={{ display: "flex", flexWrap: "wrap", width: "100%" }}>
        <Box sx={{ width: { lg: "80%", md: "100%", sm: "100%", xs: "100%" } }}>
          <TextField
        
            label="Search Category"
            sx={{ width: "100%" }}
            onChange={searchCategory}
          >
            {list.map((option) => (
              <MenuItem key={option._id} value={option.categoryName}>
                {option.categoryName}
              </MenuItem>
            ))}
          </TextField>
        </Box>

        <Box sx={{ width: { lg: "20%", md: "100%", sm: "100%", xs: "100%" }, display: "flex", justifyContent: "center", padding: "10px 0px" }}>
          <Button sx={{ backgroundColor: "#1976d2", color: "white", width: "100%" }} variant="outlined" onClick={handleClickOpen}>
            ADD CATEGORY
          </Button>

          <BootstrapDialog onClose={handleClose} open={open}>
            <DialogTitle sx={{ m: 0, p: 2 }}>Add Category</DialogTitle>
            <IconButton sx={{ position: "absolute", right: 8, top: 8, color: (theme) => theme.palette.grey[500] }} onClick={handleClose}>
              <CloseIcon />
            </IconButton>
            
            <Formik enableReinitialize initialValues={ini} onSubmit={handleSubmit}>
              <Form>
                <DialogContent dividers>
                  <Field as={TextField} name="categoryName" label="Category" fullWidth />
                </DialogContent>
                <DialogActions>
                  <Button sx={{ backgroundColor: "#1976d2", color: "white" }} type="submit">
                    Submit
                  </Button>
                </DialogActions>
              </Form>
            </Formik>
          </BootstrapDialog>
        </Box>
      </Box>

      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 700 }} aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell align="left">Category Name</StyledTableCell>
              <StyledTableCell align="right">Status</StyledTableCell>
              <StyledTableCell align="right">Delete</StyledTableCell>
              <StyledTableCell align="right">Update</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {list.map((row, i) => (
              <StyledTableRow key={row._id}>
                <StyledTableCell>{i + 1}</StyledTableCell>
                <StyledTableCell align="left">{row.categoryName}</StyledTableCell>
                <StyledTableCell align="right">{row.status}</StyledTableCell>
                <StyledTableCell align="right">
                  <IconButton onClick={() => deleteCategory(row._id)}><DeleteIcon /></IconButton>
                </StyledTableCell>
                <StyledTableCell align="right">
                  <IconButton onClick={() => editCategory(row._id, row)}><EditIcon /></IconButton>
                </StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InteviewPortal>
  );
};

export default Categary;
